import React from 'react'
import '../styles/Navbar.css'
const Navbar = () => {
  return (
    <div className='header'>
        <div className='h-item h-home'>TV-flights</div>
        <div className='h-item h-bookings'>My Bookings</div>
        <div className='h-item h-login'>Login</div>
        <div className='h-item h-register'>Register</div>
    </div>
  )
}

export default Navbar
